import React from 'react';
import { FormControl, Input, Button } from '@mui/base';

function Admin() {
  return (
    <FormControl>
      <Input />
      <Button variant="contained" color="primary">
        Submit
      </Button>
    </FormControl>
  );
}

export default Admin;
